        //地图加载完成时的添加工具栏
        function mapOnLoadCallback() {
            mapUtil.addTooBar();
            getData(userLevel);

            // fillMap(mapData);
        }

        function fillMap(jsonDataString) {
            if ('' != jsonDataString && null != jsonDataString && 'null' != jsonDataString) {
                mapUtil.drawMap(jsonDataString);
            }
        }

        function formToJson(data) {
            data = data.replace(/&/g, "\",\"");
            data = data.replace(/=/g, "\":\"");
            data = '{"' + data + '"}';
            return data;
        }
        //保存数据到本地
        function saveData() {
            var json = mapUtil.mapToJson();
            console.log(json, "已保存数据");
            $("#vSpatialinfo").val("");
            if (window.localStorage) {
                var storage = window.localStorage;
                var jsonData = $("#directReportForm").serialize();
                storage.setItem("map", JSON.stringify(json));
                storage.setItem("jsonData", formToJson(jsonData));
                storage.setItem("imgs", JSON.stringify(resourcefileurlTmp));
            }
            $("#vSpatialinfo").val(JSON.stringify(json));
        }
        //行政区弹窗的确定按钮
        function getData(lvl) {
            var level = $("#mapRegion input[name='areaLevel']:checked").attr("val");
            if (lvl) {
                level = lvl;
            }
            if (1 == level) {
                data = provinceJsonData;
            } else if (2 == level) {
                data = cityJsonData;
                if (2 == parseInt(userLevel)) {
                    data = rangeJsonData;
                }
            } else if (3 == level) {
                data = countyJosnData;
                if (2 == parseInt(userLevel)) {
                    data = cityCountyJsonData;
                } else if (3 == parseInt(userLevel)) {
                    data = rangeJsonData;
                }
            } else {
                $("#mapRegion").css('display', 'none');
                return;
            }
            mapUtil.showAreaMap(data);
        }
